import logo from './logo.svg';
import './App.css';
import React, {useContext, useEffect} from 'react';
import {login, session, SessionContext} from "./Contexts/SessionContext";

function App() {

    useEffect(() => {
       setTimeout(() => {
           console.log("Hallo");
           login();
       }, 3000);
    });
  return (
    <div className="App">

    </div>
  );
}

function isOnline() {
    return true;
}

const sessionReducer = (state, action) => {
    switch (action.type) {
        case 'attempt_login':
            state.waiting = true;
            state.loggedIn = false;
            break;
        case 'login_success':
            state.waiting = false;
            state.loggedIn = true;
            break;
        case 'login_fail':
            state.waiting = false;
            state.loggedIn = false;
            break;
    }
}

export default App;
